import React, { useState } from 'react';

function StructureDetails() {
  // State variables for form fields
  const [currentMarketValue, setCurrentMarketValue] = useState('');
  const [carpetArea, setCarpetArea] = useState('');
  const [pincode, setPincode] = useState('');
  const [buildingAge, setBuildingAge] = useState('');

  return (
    <div>
      <h2>Structure Details</h2>

      {/* Form for structure details */}
      <form>
        <div>
          <label>Current Market Value of Property: </label>
          <input type="text" value={currentMarketValue} onChange={(e) => setCurrentMarketValue(e.target.value)} />
        </div>

        <div>
          <label>Carpet Area/sq.ft: </label>
          <input type="text" value={carpetArea} onChange={(e) => setCarpetArea(e.target.value)} />
        </div>

        <div>
          <label>Enter Pincode: </label>
          <input type="text" value={pincode} onChange={(e) => setPincode(e.target.value)} />
        </div>

        <div>
          <label>Age of Building: </label>
          <div>
            {[0, 5, 10, 15, 20, 25].map((years) => (
              <label key={years}>
                <input
                  type="radio"
                  value={years}
                  checked={buildingAge === years}
                  onChange={() => setBuildingAge(years)}
                />
                {`${years}-${years + 5} years`}
              </label>
            ))}
          </div>
        </div>
      </form>
    </div>
  );
}

export default StructureDetails;
